	(79, 'Arizona Division of Occupational Safety and Health', 'ADOSH', 3, 17, '800 W. Washington Street, 2nd Floor', '', 'Phoenix', 'AZ', '85007', '(602) 542-5795', '', '(602) 542-1614', 'http://www.ica.state.az.us/ADOSH/ADOSH_main.aspx', 'comments.adosh@dol.gov', 'Darin Perkins', 'Director', '', '', 0, '', 'Region 9', 1, '', 0, 'The Mission Statement of the Industrial Commission is to efficiently administer and effectively enforce all applicable laws and regulations not specifically delegated to others, relative to the protection of life, health, safety, and welfare of employees within the State.', 1),
	(80, 'California Division of Occupational Safety and Health', 'DOSH', 3, 17, '1515 Clay Street Suite 1901', '', 'Oakland', 'CA', '94612', '(510) 286-7000', NULL, '(510) 286-7037', 'http://www.dir.ca.gov/occupational_safety.html', '', 'Chris Lee', 'Deputy Chief', '', '', 0, '', 'Region 9', 1, '', 0, 'The Division of Occupational Safety and Health, better known as Cal/OSHA, protects workers and the public from safety hazards through its Occupational Safety and Health, elevator, amusement ride, aerial tramway, ski lift and pressure vessel inspection programs, and also provides consultative assistance to employers.', 1),
	(81, 'Connecticut Occupational Safety and Health Division', 'CONN-OSHA', 3, 17, '38 Wolcott Hill Road', '', 'Wethersfield', 'CT', '06109', '(860) 263-6900', '', '(860) 263-6940', 'http://www.ctdol.state.ct.us/osha/osha.htm', '', 'Kenneth Tucker', 'Program Manager', '', '', 0, '', 'Region 1', 1, '', 0, 'The Connecticut Department of Labor\'s Division of Occupational Safety and Health is referred to as CONN-OSHA. CONN-OSHA administers Connecticut\'s Public Employer Only State Plan and enforces occupational safety and health standards as they apply to all municipal and state employees.  As a State Plan state, CONN-OSHA adopts and enforces standards that are at least as effective as the federal requirements. CONN-OSHA does not enforce occupational safety and health standards in private businesses in Connecticut.  In those businesses, OSHA standards are enforced by the U.S. Department of Labor, Occupational Safety and Health Administration (USDOL-OSHA).', 1),
	(82, 'Hawaii Occupational Safety and Health', 'HIOSH', 3, 17, '830 Punchbowl Street, Suite 425', '', 'Honolulu', 'HI', '96813', '(808) 586-9100', '', '(808) 586-9104', 'http://hawaii.gov/labor/hiosh', 'dlir.hiosh@hawaii.gov', 'Jamesner A. Dumlao', '', '', '', 0, '', 'Region 9', 1, '', 0, 'The Hawaii Occupational Safety and Health Law and Regulations are intended to assure safe and healthful working conditions for the women and men of the State.  Employers are responsible to furnish employees with workplaces that are safe and free from recognized hazards.', 1),
	(83, 'Illinois Department of Labor ', 'IDOL', 3, 17, '1 W. Old State Capitol Plaza, Room 300', '', 'Springfield', 'IL', '62701', '(217) 782-6206', '', '(217) 782-0596', 'http://www.state.il.us/agency/idol/', '', 'Catherine Shannon', '', '', '', 0, '', 'Region 5', 1, '', 0, '', 1),
	(84, 'Indiana Occupational Safety and Health Administration', 'IOSHA', 3, 17, '402 West Washington Street', 'Room W-195', 'Indianapolis', 'IN', '46204', '(317) 232-2655', '', '(317) 233-3790', 'http://www.in.gov/dol/iosha.htm', '', 'Jeffry Carter', '', '', '', 0, '', 'Region 5', 1, '', 0, '', 1),
	(85, 'Iowa Occupational Safety and Health Enforcement', 'IOSH', 3, 17, '1000 E Grand Avenue', '', 'Des Moines', 'IA', '50319', '(515) 242-5870', '', '(515) 281-7995', 'http://www.iowaworkforce.org/labor/iosh/index.html', '', 'David Neil', '', '', '', 0, '', 'Region 7', 1, '', 0, '', 1),
	(86, 'Kentucky Occupational Safety and Health Program', 'KOSH', 3, 17, '1047 U.S. Highway 127 South', '', 'Frankfort', 'KY', '40601', '(502) 564-3070', '', '(502) 564-5387', 'http://www.labor.ky.gov/ows/osh/', '', 'Michael L. Dixon', '', '', '', 0, '', 'Region 4', 1, '', 0, '', 1),
	(87, 'Maryland Occupational Safety and Health', 'MOSH', 3, 17, '10946 Golden West Drive, Suite 160', '', 'Hunt Valley', 'MD', '21031', '(410) 527-4499', '', '(410) 527-4495', 'http://www.dllr.state.md.us/labor/mosh/', '', 'Eric Uttenreither', 'Assistant Commissioner', '', '', 0, '', 'Region 3', 1, '', 0, 'MOSH\'s mission is to promote and assure workplace safety and health and reduce workplace fatalities, injuries and illnesses.', 1),
	(88, 'Michigan Occupational Safety & Health Administration', 'MIOSHA', 3, 17, '7150 Harris Drive', 'P.O. Box 30643', 'Lansing', 'MI', '48909', '(517) 322-1817', '', '(517) 322-1775', 'http://www.michigan.gov/miosha', '', 'Douglas J. Kalinowski', '', '', '', 0, '', 'Region 5', 1, '', 0, 'The mission of the MIOSHA is to help assure the safety and health of Michigan workers.', 1),
	(89, 'Minnesota Department of Labor and Industry', 'MNOSHA', 3, 17, 'Minnesota OSHA Compliance', '443 Lafayette Road North', 'St. Paul', 'MN', '55155', '(651) 284-5050', '(651) 297-4198', '(651) 284-5741', 'http://www.dli.mn.gov/MnOsha.asp', 'osha.compliance@state.mn.us', 'Steve Sviggum', '', '', '', 0, '', 'Region 5', 1, '', 0, 'Labor and Industry is committed to ensuring equitable, healthy and safe work and living environments in Minnesota. Through outreach, education and compliance efforts, we strive to improve the quality of life for Minnesota workers and their families. Our goals are geared toward reducing and minimizing the impact of workplace injuries and illnesses; helping resolve workplace complaints and disputes; ensuring compliance and awareness about workplace requirements; and assuring quality construction, operation and maintenance of structures. We hope to continually build safer and healthier work environments in Minnesota.', 1),
	(90, 'Nevada Occupational Safety and Health Administration', 'Nevada OSH', 3, 17, '1301 N. Green Valley Parkway, Suite 200', '', 'Henderson', 'NV', '89074', '(702) 486-9020', '', '(702) 990-0365', 'http://dirweb.state.nv.us/OSHA/osha.htm', '', 'Steve Coffield', '', '', '', 0, '', 'Region 9', 1, '', 0, '', 1),
	(91, 'Public Employee Occupational Safety and Health Program', 'PEOSH', 3, 17, 'One John Fitch Plaza - State Office Building Campus', 'PO Box 110', 'Trenton', 'NJ', '8625', '(609) 633-3896', '', '(609) 292-3749', 'http://lwd.dol.state.nj.us/labor/lsse/employer/Public_Employees_OSH.html', '', 'Harold J. Wirths', '', '', '', 0, '', 'Region 2', 1, 'Region 2', 0, '', 1),
	(92, 'New Mexico Occupational Health and Safety Bureau', 'OHSB', 3, 17, '525 Camino de los Marquez, Suite 3', '', 'Santa Fe', 'NM', '87505', '(505) 476-8700', '', '(505) 476-8734', 'http://www.nmenv.state.nm.us/Ohsb_Website/index.htm', '', 'Mary Uhl', 'Bureau Chief', 'mary.uhl@state.nm.us', '(505) 476-8787', 0, '', 'Region 6', 1, '', 0, 'The Occupational Health and Safety Bureau (OHSB) is a state regulatory agency that is part of the New Mexico Environment Department. It has the responsibility of enforcing Occupational Health and Safety Regulations within New Mexico. New Mexico has adopted the Federal OSHA Regulations and has promulgated some State specific regulations. The scope of NM OHSB\'s jurisdiction includes all private industry and public entities such as city, county, and state government; excluding Federal Employees.', 1),
	(93, 'New York State Plan for Public Employee Safety and Health', 'PESH', 3, 17, 'Governor W. Averell Harriman State Building Campus', 'Building 12, Room 158', 'Albany', 'NY', '12240', '(518) 457-1263', '', '(518) 457-5545', 'http://www.labor.state.ny.us/workerprotection/safetyhealth/DOSH_PESH.shtm', '', 'Maureen Cox', '', '', '', 0, '', 'Region 2', 1, '', 0, '', 1),
	(94, 'North Carolina Department of Labor', 'NCDOL', 3, 17, 'Occupational Safety and Health Division', '111 Hillsborough Street', 'Raleigh', 'NC', '27601', '(919) 733-7166', '', NULL, 'http://www.nclabor.com/osha/osh.htm', '', 'Allen McNeely', '', '', '', 0, '', 'Region 4', 1, '', 0, '', 1),
	(95, 'Oregon Occupational Safety and Health Division', 'OR-OSHA', 3, 17, 'P.O. Box 14480', '350 Winter St. NE, Rm. 430', 'Salem', 'OR', '97309', '(503) 378-3272', '', '(503) 947-7461', 'http://www.orosha.org/', '', 'Michael Wood', '', '', '', 0, '', 'Region 10', 1, '', 0, '', 1),
	(96, 'Puerto Rico Occupational Safety and Health Administration', 'PR OSHA', 3, 17, 'Prudencio Rivera Martinez Building, 21st Floor', '505 MuÃ±oz Rivera Avenue', 'Hato Rey', 'PR', '918', '(787) 756-1101', '', '(787) 767-6051', 'http://www.dtrh.gobierno.pr/PROSHA.asp?m=6', '', 'Gladys Cruz-Mercado', '', '', '', 0, '', 'Region 2', 1, '', 0, '', 1),
	(97, 'South Carolina Occupational Safety and Health Plan', 'SCOSH', 3, 17, 'P.O. Box 11329', '', 'Columbia', 'SC', '29211', '(803) 896-7665', '', '(803) 896-7670', 'http://www.scosha.llronline.com/', '', 'Dorothy \"\"Dottie\"\" Ison', '', '', '', 0, '', 'Region 4', 1, '', 0, '', 1),
	(98, 'Tennessee Department of Labor and Workforce Development', 'TOSHA', 3, 17, 'Division of Occupational Safety and Health', '220 French Landing Drive', 'Nashville', 'TN', '37243', '(615) 741-2793', '', '(615) 741-5078', 'http://www.state.tn.us/labor-wfd/tosha.html', '', 'Steve Hawkins', 'Assistant Administrator', 'steve.hawkins@tn.gov', '', 0, '', 'Region 4', 1, '', 0, 'TOSHA\'s mission is to assure the safety and health of Tennessee\'s workers by setting and enforcing standards; providing training, outreach, and education; establishing partnerships; and encouraging continual improvement in workplace\r\nsafety and health.', 1),
	(99, 'Utah Occupational Safety and Health Division', 'UOSH', 3, 17, '160 East 300 South', 'PO Box 146650', 'Salt Lake City', 'UT', '84114', '(801) 530-6901', '', '(801) 530-7606', 'http://www.laborcommission.utah.gov/UOSH/index.html', '', 'Louis M. Silva', '', '', '', 0, '', 'Region 8', 1, '', 0, '', 1),
	(100, 'Vermont Occupational Safety and Health Program', 'VOSHA', 3, 17, '5 Green Mountain Drive', 'PO Box 488', 'Montpelier', 'VT', '5601', '(802) 828-4000', '', '(802) 888-4022', 'http://www.labor.vermont.gov/Default.aspx?tabid=74', '', 'Robert McLeod', '', '', '', 0, '', 'Region 1', 1, '', 0, '', 1),
	(101, 'Virgin Islands Department of Labor, Division of Occupational Safety and Health', 'VIDOSH', 3, 17, '3012 Golden Rock', 'Christiansted', 'St. Croix', 'VI', '890', '(340) 772-1315', '', '(340) 772-4323', 'http://www.vidol.gov/Units/OSHA/OSHA.htm', '', 'Jannette Barbos', '', '', '', 0, '', 'Region 2', 1, '', 0, '', 1),
	(102, 'Virginia Department of Labor and Industry', 'VOSH', 3, 17, 'Powers-Taylor Building', '13 South 13th Street', 'Richmond', 'VA', '23219', '(804) 786-2391', '', '(804) 371-6524', 'http://www.doli.virginia.gov/', '', 'Ed Hegamyer', '', '', '', 0, '', 'Region 3', 1, '', 0, 'The Virginia Occupational Safety and Health Compliance Program conducts inspections of private and public sector employers to assure compliance with the laws, standards and regulations of the Commonwealth. The Compliance Program may issue citations listing violations of the standards and regulations to employers, determines dates by which violations must be abated, and may propose civil monetary penalties for certain types of violations (Public Sector employers are not issued such penalties).', 1),
	(104, 'Wyoming OSHA', 'OSHA', 3, 17, '1510 E. Pershing Blvd., West Wing', '', 'Cheyenne', 'WY', '82002', '(307) 777-7786', '', '(307) 777-3646', 'http://doe.wyo.gov/aboutus/OSHA/Pages/default.aspx', 'atruji@state.wy.us', 'J.D. Danni', 'OSHA Program Manager', '', '', 0, '', 'Region 8', 1, '', 0, 'The purpose of this organization is to assure that insofar as possible every working person within this state shall have safe and healthful working conditions free from recognized hazards and to preserve our state\'s human resources: that the prevention of accidents and occupational diseases and abiding by rules and regulations are the responsibility of both the employer and the employee; and to help and assist employers and employees in accident and occupational disease prevention through educational means, which shall be made available to all industries, businesses, employees, employee groups and associations.', 1),
