	(424, 'Internal Revenue Service', 'IRS', 1, 27, '10th St & Pennsylvania Ave, NW', '', 'Washington', 'DC', '20004', '(800) 829-4933', '', NULL, 'http://www.irs.gov', '', '', '', '', '', 0, '', '', 0, '', 0, 'The IRS is organized to carry out the responsibilities of the secretary of the Treasury under section 7801 of the Internal Revenue Code. The secretary has full authority to administer and enforce the internal revenue laws and has the power to create an agency to enforce these laws. The IRS was created based on this legislative grant.', 1),
