	(455, 'ASTM International', 'ATSM', 2, 23, '100 Barr Harbor Drive', 'PO Box C700', 'West Conshohocken', 'PA', '19428-2959', '(877) 909-2786', '', NULL, 'http://www.astm.org', '', '', '', '', '', 0, '', '', 0, '', 0, 'ASTM International, formerly known as the American Society for Testing and Materials (ASTM), is a globally recognized leader in the development and delivery of international voluntary consensus standards. Today, some 12,000 ASTM standards are used around the world to improve product quality, enhance safety, facilitate market access and trade, and build consumer confidence.', 1),
	(456, 'Office of Civil Rights', 'OCR', 1, 30, '200 Independence Avenue, SW', 'Room 509F, HHH Building', 'Washington', 'DC', '20201', '(800) 368-1019', '(800) 537-7697', NULL, 'http://www.hhs.gov/ocr/office/index.html', 'ocrmail@hhs.gov', '', '', '', '', 0, '', '', 0, '', 0, 'As the DHHS\'s civil rights and health privacy rights law enforcement agency, OCR investigates complaints, enforces rights, and promulgates regulations, develops policy and provides technical assistance and public education to ensure understanding of and compliance with non-discrimination and health information privacy laws.', 1),
