	(462, 'Florida Administrative Code', 'FAC', 3, 33, 'Florida Department of State', 'R.A. Gray Building, Mail Station 22', 'Tallahassee', 'FL', '32399-0250', '(850) 245-6270', NULL, '(850) 488-9879', 'https://www.flrules.org', 'administrativecode@dos.state.fl.us', '', '', '', '', 0, '', '', 0, '', 0, '', 1),
	(463, 'Florida Department of Elder Affairs', 'DOEA', 3, 34, '4040 Esplanade Way', '', 'Tallahassee', 'FL', '32399-7000', '(850) 414-2000', '(850) 414-2001', '(850) 414-2004', 'http://elderaffairs.state.fl.us/', 'information@elderaffairs.org', '', '', '', '', 0, '', '', 0, '', 0, 'The Florida Department of Elder Affairs is the agency constitutionally designated by Florida voters to serve as the primary state agency responsible for administering human services programs for the elderly. Its purpose is to serve elders in all possible ways to help them keep their self-sufficiency and self-determination.', 1),
	(464, 'American Medical Association', 'AMA', 2, 36, '515 N. State Street', '', 'Chicago', 'IL', '60654', '(800) 621-8335', NULL, NULL, 'http://www.ama-assn.org', '', '', '', '', '', 0, '', '', 0, '', 0, 'The American Medical Association helps doctors help patients by uniting physicians nationwide to work on the most important professional and public health issues.', 1),
	(465, 'National Uniform Claim Committee', 'NUCC', 2, 37, 'NUCC Chair, American Medical Association', '515 N. State St.', 'Chicago', 'IL', '60654', '(800) 621-8335', NULL, NULL, 'http://www.nucc.org', 'info@nucc.org', 'Nancy Spector', '', '', '', 0, '', '', 0, '', 0, 'The National Uniform Claim Committee (NUCC) is a voluntary organization that replaced the Uniform Claim Form Task Force in 1995.  The committee was created to develop a standardized data set for use by the non-institutional health care community to transmit claim and encounter information to and from all third-party payers. It is chaired by the American Medical Association (AMA), with the Centers for Medicare and Medicaid Services (CMS) as a critical partner.', 1),
	(466, 'Department of Revenue: Child Support Services Division', 'CSSD', 3, 14, '240 Main Street, First Floor', '', 'Juneau', 'AK', '99801-0402', '(907) 269-6900', '(907) 269-6894', '(907) 787-3220', 'http://www.csed.state.ak.us/default.asp', 'dor.cssd.customerservice.anchorage@alaska.gov', '', '', '', '', 0, '', '', 0, '', 0, 'The Alaska Child Support Services Division consists of about 230 employees responsible for collecting child support for tens of thousands of children.', 1),
	(585, 'Arkansas State Medical Board', 'ASMB', 3, 20, '1401 West Capitol Avenue, Suite 340', NULL, 'Little Rock', 'AR', '72201-2936', '(501) 296-1802', NULL, '(501) 296-1972', 'http://www.armedicalboard.org', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, 'The Arkansas State Medical Board is charged by the General Assembly to protect the health, safety, and welfare of the people of the State of Arkansas with the goal that all citizens are provided with the highest quality health care.', 1),
	(467, 'U.S. Department of Labor', 'USDOL', 1, 3, 'Frances Perkins Building', '200 Constitution Ave, NW', 'Washington', 'DC', '20210', '(866) 487-9243', '(877) 889-5627', NULL, 'www.dol.gov', '', '', '', '', '', 0, '', '', 0, '', 0, 'To foster, promote, and develop the welfare of the wage earners, job seekers, and retirees of the United States; improve working conditions; advance opportunities for profitable employment; and assure work-related benefits and rights.', 1),
	(468, 'American Association for Respiratory Care', 'AARC', 2, 21, '9425 N. MacArthur Blvd. Suite 100', NULL, 'Irving', 'TX', '75063-4706', '(972) 243-2272', NULL, '(972) 484-2720', 'http://www.aarc.org', 'info@aarc.org', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, 'AARCs mission is to advance the science, technology, ethics, and art of respiratory care through research and education for its members and to teach the general public about pulmonary health and disease prevention.', 1),
	(469, 'Office of Professional Licensing', NULL, 3, 20, '333 W. Willoughby Ave. 9th Floor', NULL, 'Juneau', 'AK', '99801', '(907) 465-2550', NULL, '(907) 465-2974', 'http://www.commerce.state.ak.us/occ/home_professional_lic.html', 'license@alaska.gov', NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, 'Currently there are no requirements for continuing education for Respiratory Care Practitioners.', 1),
	(470, 'Alabama State Board of Respiratory Therapy', 'ASBRT', 3, 20, 'P.O. Box 241386', NULL, 'Montgomery', 'AL', '36124-1386', '(334) 396-2332', NULL, '(334) 396-2384', 'http://www.asbrt.alabama.gov', 'paulamccaleb@gmail.com', 'Paula Scout McCaleb', 'Executive Director', 'paulamccaleb@gmail.com', NULL, 0, NULL, NULL, NULL, NULL, 0, 'To protect the citizenry against the unauthorized, unqualified, and improper administration of respiratory therapy and from unprofessional or unethical conduct by persons licensed to practice respiratory therapy (Section 34-27-B-1).', 1),
	(471, 'Arizona State Board of Resiratory Care Examiners', NULL, 3, 20, '1400 West Washington, Suite 200', NULL, 'Phoenix', 'AZ', '85007', '(602) 542-5995', NULL, '(602) 542-5900', 'http://www.rb.az.gov', 'info@rb.az.gov', NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, 'The Legislature finds and declares that the practice of respiratory care in this state affects the public health, safety and welfare and should be subject to regulation and control by the Board of Respiratory Care Examiners in the public interest to protect the public from unauthorized and unqualified practice of respiratory care and from unprofessional conduct by persons licensed to practice respiratory care.', 1),
	(472, 'Division of Professions and Occupations', NULL, 3, 20, '1560 Broadway, Suite 1350', NULL, 'Denver', 'CO', '80202', '(303) 894-7800', NULL, '(303) 894-7693', 'www.dora.state.co.us/respiratory-therapy/', 'dora_registrations@state.co.us', NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, 'The mission of the Office is to maintain the professions integrity and protect its consumers. The Office works in conjunction with the National Board of Respiratory Care (NBRC).', 1),
	(474, 'Department of Public Health', NULL, 3, 20, '410 Capitol Avenue', 'MS #12APP', 'Hartford', 'CT', '06134-0308', '(860) 509-7603', NULL, '(860) 509-8457', 'www.ct.gov/dph', 'dph.alliedhealth@ct.gov', NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, 1),
	(475, 'Board of Medical Licensure and Discipline', NULL, 3, 20, 'Cannon Building, Suite 203', '861 Silver Lake Blvd.', 'Dover', 'DE', '19904-2467', '(302) 744-4500', NULL, '(302) 739-2711', 'http://www.dpr.delaware.gov/boards/medicalpractice/index.shtml', 'customerservice.dpr@state.de.us', NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, 'The Board is responsible for the licensing of physicians (MD & DO), physician\'s assistants, respiratory care practitioners, emergency medical technicians - paramedics, acupuncture practitioners, acupuncture detoxification specialists, and genetic counselors.', 1),
	(476, 'Board of Respiratory Care', NULL, 3, 20, '899 North Capitol Street., NE, First Floor', NULL, 'Washington', 'DC', '20002', '(202) 724-8826', NULL, '(202) 727-8471', 'http://doh.dc.gov/node/161462', 'doh@dc.gov', NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, 'The Board of Respiratory Care regulates the practice of respiratory care in DC.', 1),
	(477, 'Board of Respiratory Care', NULL, 3, 20, '4052 Bald Cypress Way', 'Bin C-05', 'Tallahassee', 'FL', '32399-3255', '(850) 245-4373', NULL, '(850) 414-6860', 'www.doh.state.fl.us/mqa/respiratory/', 'MQA_RespiratoryTherapy@doh.state.fl.us', NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, 'The Florida Department of Health, through its Division of Medical Quality Assurance (MQA), determines that health care practitioners meet minimum competency requirements.', 1),
